import React from "react";
import { Table, Button ,Jumbotron} from "reactstrap";

export default (props) => {
    return (
        <div>
            <Jumbotron>
                <h1 className="display-4" align="center">Atualiza preço de Produto</h1>

  </Jumbotron>
            <Table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Nome</th>
                        <th>Preço de custo</th>
                        <th>Preço de venda</th>
                    </tr>
                </thead>
                <tbody></tbody>
            </Table>
            <row>
                <column>
            <label htmlFor="margem" align="left">Margem de Lucro (%):</label></column>
            <column> <input
                type="text"
                className="form-control"
                id="margemLucro"
                required
                // value={this.state.cpf}
                // onChange={this.onChangeCpf}
                name="margemLucro" align="right"
            /></column></row>
            <Button color="secondary">Atualizar preço</Button>{" "}
        </div>
    );
};
